icado = window.atob(dadoCodificado); // decodifica a string\n   */\n  base64 = {\n    encoding: (data) => {\n      try {\n        return of(window.btoa(JSON.stringify({ data: data }))).pipe(\n          catchError((e) => {\n            this.log.SEVERE({ component: 'WindowService', method: 'base64.encoding', value: JSON.stringify(data), error: e });\n            return throwError(e);\n          }));\n      } catch (error) {\n        this.log.SEVERE({ component: 'WindowService', method: 'base64.decoding', value: JSON.stringify(data), error: error });\n        return throwError(error);\n      }\n    },\n    decoding: (data) => {\n      try {\n        return of(JSON.parse(window.atob(data)).data).pipe(\n          catchError((e) => {\n            this.log.SEVERE({ component: 'WindowService', method: 'base64.decoding', value: JSON.stringify(data), error: e });\n            return throwError(e);\n          }));\n      } catch (error) {\n        this.log.SEVERE({ component: 'WindowService', method: 'base64.decoding', value: JSON.stringify(data), error: error });\n        return throwError(error);\n      }\n    }\n  };\n\n  getUrl() {\n    return of(location.href);\n  }\n\n  redirect(link: string): void {\n    try {\n      this.log.FINE(`window.location.replace : ${link}`);\n      window.location.replace(`http://${link}`);\n    } catch (e) {\n      this.log.INFO(e);\n    }\n  }\n\n  constructor(private log: LogService) { }\n\n  // set scrollTop(value: number) {\n  //   document.body.scrollTop = document.documentElement.scrollTop = value;\n  // }\n\n  scrollTop(document, value: number) {\n    return document.documentElement.scrollTop = value;\n  }\n\n  get windowRef() {\n    return window;\n  }\n\n  setStorage(key, value) {\n    try {\n      window.localStorage[key] = value;\n    } catch (e) {\n      this.log.INFO(e);\n    }\n  }\n\n  getStorage(key) {\n    try {\n      return window.localStorage[key] || null;\n    } catch (e) {\n      this.log.INFO(e);\n      return null;\n    }\n  }\n\n  removeStorage(key) {\n    try {\n      window.localStorage.removeItem(key);\n    } catch (e) {\n      this.log.INFO(e);\n    }\n  }\n\n\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"changelog.html":{"url":"changelog.html","title":"getting-started - changelog","body":"\n                   \n\n0.0.1\n\nAplicao com Angular 10\nService Work\nCompodoc\nBundleAnalizer\nlighthouse\nGzip e brotli\nAot e Ivy\nWebworker habilitado\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"contributing.html":{"url":"contributing.html","title":"getting-started - contributing","body":"\n                   \n\nPRPL  um padro de estruturao e fornecimento de Progressive Web Apps (PWAs) com nfase no desempenho de lanamento e fornecimento do aplicativo.\nEle significa:\n(x) Push (enviar) recursos crticos para a rota do URL inicial.\n(x) Render (renderizar) a rota inicial.\n(X) Pre-cache (armazenar em cache) as demais rotas.\n(x) Lazy-load (carregar com atraso) e criar demais rotas de acordo com a ao do usurio.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n        \n            \n                \n                src/app/app.component.ts\n            \n            component\n            AppComponent\n            \n                0 %\n                (0/17)